import React, { Component } from 'react';
import Input from './input/Input';
import Button from './button/Button';

export class Login extends Component {
    static displayName = Login.name;

  render () {
    return (
      <div>
            Login
            <Input/>
            <Input />
            <Button/>
      </div>
    );
  }
}
